def str2time(a1):
#字符串时间转时间戳	
	
	# 先转换为时间数组
	timeArray = time.strptime(a1, "%Y-%m-%d %H:%M:%S")
	# 转换为时间戳
	timeStamp = int(time.mktime(timeArray))
	return timeStamp

def getW(dicts):
    """
    利用 polar 距离 获得相似矩阵
    :param data: 样本集合
    :return:
    """
    Matrix = np.zeros((len(dicts), len(dicts)))
    for i, no_i in enumerate(dicts):
        for j, no_j in enumerate(dicts):
            if i == j:
                pass
            else:
                Matrix[i][j] = Levenshtein.seqratio(dicts[no_i], dicts[no_j])
            print(i,j)

    return Matrix

def getD(W):
    """
    获得度矩阵
    :param W:  相似度矩阵
    :return:   度矩阵
    """
    D = np.diag(sum(W))
    return D

def getL(D, W):
    """
    获得拉普拉斯矩阵
    :param W: 相似度矩阵
    :param D: 度矩阵
    :return: 拉普拉斯矩阵
    """
    return D - W

def getEigen(L):
    """
    从拉普拉斯矩阵获得特征(映射)矩阵
    :param L: 拉普拉斯矩阵
    :return:
    """
    eigval, eigvec = np.linalg.eig(L)
    # 取特征向量的前 4 个，但第一个都一样，可以去掉
    ix = np.argsort(eigval)[0:4]
    return eigvec[:, ix]

def k_gram(seq,k):
	seq_list=[]
	if k>len(seq):
		return seq_list
	else:
		for i in range(0,len(seq)-k+1):
			seq_list.append(seq[i:i+k])

	return seq_list

def get_bing(list1,list2):
	t=[]
	for row in list1:
	    if row not in t:
	        t.append(row)
	        
	for row in list2:
		if row not in t:
			t.append(row)
	
	return t

def get_jiao(list1,list2):
	t=[]
	
	for row in list1:
		if row in list2 and row not in t:
			t.append(row)
	
	return t

def get_Jaccard(list1,list2,k):
	l1=k_gram(list1,k)
	l2=k_gram(list2,k)

	# ~ print(l1)
	# ~ print(l2)
	
	return len(get_jiao(l1,l2))/len(get_bing(l1,l2))

def find_index(lists, find):
    """
    在lists里面，找出find在lists的索引
    :param lists: 列表
    :param find: 列表中的一个元素
    :return: 一个在lists里面，找出find在lists的索引列表
    """
    flag = 0
    list_index = []
    for n in range(lists.count(find)):
        sec = flag
        flag = lists[flag:].index(find)
        list_index.append(flag + sec)
        flag = list_index[-1:][0] + 1
    return list_index

def get_sim(list1,list2,k):
	l1=k_gram(list1,k)
	l2=k_gram(list2,k)

	# ~ print(l1)
	# ~ print(l2)
	
	
	t=get_bing(l1,l2)
	
	c1=[]
	c2=[]
	
	for l in t:
		num1=0
		num2=0
		for row in l1:
			if row==l:
				num1+=1
		for row in l2:
			if row==l:
				num2+=1
		c1.append(num1/len(l1))
		c2.append(num2/len(l2))
	
	# ~ print(c1)
	# ~ print(c2)
	
	sum1=0
	sum_c1=0
	sum_c2=0
	for i in range(0,len(c1)):
		sum1+=c1[i]*c2[i]
		sum_c1+=c1[i]**2
		sum_c2+=c2[i]**2
	
	# ~ print(sum1)
	# ~ print(sum_c1)
	# ~ print(sum_c2)

	cos=sum1/((sum_c1**0.5)*(sum_c2**0.5))

	return cos

